import React, { useState } from 'react';
//material core
import { makeStyles } from "@material-ui/core/styles";
import Icon from "@material-ui/core/Icon";
//components
import GridContainer from '../../components/Grid/GridContainer';
import GridItem from '../../components/Grid/GridItem';
import Card from '../../components/Card/Card';
import CardHeader from '../../components/Card/CardHeader';
import CardIcon from '../../components/Card/CardIcon';
import CardFooter from '../../components/Card/CardFooter'
import CardBody from '../../components/Card/CardBody'
// @material-ui/icons
import Store from "@material-ui/icons/Store";
//typografia
import Danger from '../../components/Typography/Danger';
import Warning from '../../components/Typography/Warning';
//form
import InputAdornment from '@material-ui/core/InputAdornment';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import AccountCircle from '@material-ui/icons/AccountCircle';


function searchInsumo() {
    const [login, setLogin] = useState('');

    async function handleLogin(e) {
        e.preventDefault();
        try {
            const data = {
                "login": login,
                "senha": values.password
            }
            //console.log(data)
            //await api.post('/', data);
            sessionStorage.setItem('login', data.login)
            //localStorage.setItem('senha', response.data.senha)
            history.push('/admin')

        } catch (err) {
            alert(`Falha no login, tente novamente:\n ${err}`);
        }
    }

    return (
        <div>
            <GridContainer>
                <GridItem xs={12} sm={12} md={12}>
                    <Card>
                        <CardHeader color="warning" stats icon>
                            <CardIcon color="warning">
                                <Icon> <Store /></Icon>
                            </CardIcon>
                            <p>Pesquisa de Insumos</p>
                        </CardHeader>
                        <CardBody>
                            <FormControl required fullWidth variant="outlined" margin='normal'>
                                <InputLabel htmlFor="outlined-adornment-login">Login</InputLabel>
                                <OutlinedInput
                                    id="outlined-adornment-login"
                                    labelWidth={70}
                                    value={login}
                                    onChange={e => setLogin(e.target.value)}
                                    endAdornment={
                                        <InputAdornment position="end">
                                            <AccountCircle />
                                        </InputAdornment>
                                    }
                                />
                            </FormControl>
                        </CardBody>
                        <CardFooter stats>
                            <div >
                                <Danger>
                                    <Warning>ex</Warning>
                                </Danger>
                            </div>
                        </CardFooter>
                    </Card>
                </GridItem>
            </ GridContainer>
        </div>
    )
}

export default searchInsumo;
